  ngOnInit() {
    this.loadingService.abrirModal();
    this.activatedRoute.paramMap.subscribe((params) => {
      const id = +params.get('id');
      this.facturaService.getFactura(id).subscribe((factura) => {
        (this.factura = factura), this.loadingService.cerrarModal();
      });
    });
    this.cargarSucursal();
  }

  cargarSucursal() {
    this.sucursal = this.funcionesService.getDatos();
  }

  redondearGanancia(ganancia: number): string {
    const gananciaRedondeada = ganancia.toFixed(2);
    return this.formatNumber(parseFloat(gananciaRedondeada));
  }

